import React from "react";
import ReactDOM from "react-dom";
import Image from "./Mep";
import Photo from "./Narr";
import"./index.css";
//console.log(image[0].img);

//const M =image.map(function(index){
  //return index;
//})

const Slot=(props)=>{
  let x =props.x;
  let y=props.y;
  let z=props.z;
  if(x===y && y===z){
    return(
      <>
      <div className="styl">
    <h1>{x}{y}{z}</h1>
    <h1>this is matching</h1>
      </div></>
    )}
    else{
      return(
        <>
        <div  className="styl">
        <h1>{x}{y}{z}</h1>
        <h1>this is not matching</h1>
        </div>
        </>
      )
    }

}

ReactDOM.render(
<>
<span>
<h1> 😄 </h1>

</span>
<Slot x="😄" y="😄"  z="😄"/>
<Slot  x="😆" y="🎅"  z="🎅"/>
<Slot  x="😄" y="😄"  z="🧔"/>
<Slot  x="🧙‍♀️" y="😄"  z="😄"/>
<Slot  x="🧑‍🔬" y="🧑‍🔬" z="🧑‍🔬"/>
</>,
  
document.getElementById('root'));
